const Home = () => {
  return (
    <>
      <div className='row'>
        <div className='col s12'>
          <div className='row'>
            <div className='input-field col s12'>
              <i class='fab fa-searchengin prefix'></i>
              <input
                type='text'
                id='autocomplete-input'
                className='autocomplete'
              />
              <label for='autocomplete-input'>Autocomplete</label>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
